import React from 'react';
import { BrowserRouter as Router, Route } from 'react-router-dom';
import Home from './Components/Layout/Home'

const App = () => (
    <Router>
        <div>
            <Route exact path="/" component={Home}/>
        </div>
    </Router>
)


export default App;
